/* Reset and base styles */
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

/* Different order of main selectors */
.container {
    max-width: 1000px;
    margin: 0 auto;
    padding: 15px;
}

body {
    line-height: 1.5;
    color: #444;
    background-color: #eaeaea;
}

/* Different order of properties within selectors */
.color-box {
    margin: 5px;
    border-radius: 5px;
    display: inline-block;
    width: 50px;
    height: 50px;
}

/* Header styles */
header {
    background-color: #2c3e50;
    color: white;
    padding: 15px;
    margin-bottom: 15px;
}

header h1 {
    margin-bottom: 15px;
    color: #ecf0f1;
}

nav ul {
    display: block;
    list-style: none;
}

nav ul li {
    margin-right: 15px;
    display: inline-block;
}

nav ul li a {
    color: #ecf0f1;
    text-decoration: none;
}

nav ul li a:hover {
    color: #e74c3c;
}

/* Button styles with different order of properties */
button {
    border: none;
    padding: 8px 12px;
    cursor: pointer;
    border-radius: 2px;
    background-color: #e74c3c;
    color: white;
}

.button-container {
    display: flex;
    gap: 10px;
    margin: 20px 0;
}

.primary {
    background-color: #4299e1;
}

.secondary {
    background-color: #a0aec0;
}

.danger {
    background-color: #f56565;
}

/* Main content styles */
main {
    background-color: #ecf0f1;
    padding: 15px;
    border-radius: 3px;
    box-shadow: 0 0 5px rgba(0, 0, 0, 0.2);
}

